import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';

function Nav() {
    const navStyle = {
        color: 'white'
    };

    return (
        <div className="nav-bar">
            <nav>
                <ul>
                    <Link style={navStyle} to="/">
                        <li>Home</li>
                    </Link>
                        <li>Phonemes</li>
                        <li>Morphemes</li>
                        <li>Testing</li>
                </ul>
            </nav>
        </div>
    );
}
export default Nav;
